export default function Footer() {
  return (
    <div className="mt-[1000px]">
      <section className="relative">
        <div className="bg-white w-full h-[231px]"></div>
        <div className="absolute top-[45px] left-0 right-0 mx-auto w-4/5 h-[370px] bg-[#FF2E00] rounded-2xl text-white flex flex-col justify-center items-center z-10">
          <div className="text-center">
            <p className="text-xl font-normal mt-0">Unlock your Dream affordable Ride with our TruRide</p>
            <p className="text-5xl font-bold mt-1">Download the App Now!</p>
            <p className="text-xl font-normal mt-0">TruRide: AI-powered ride booking with gamified routes.</p>
            <p className="text-xl font-normal mt-0">Users earn rewards; drivers get bonuses via AI-enhanced mapping.</p>
          </div>
          <div className="flex justify-center mt-10">
            <img src={apple} className="w-[185px] h-[53px]" alt="apple" />
            <img src={pstore} className="w-[185px] h-[53px] ml-5" alt="pstore" />
          </div>
        </div>
        <div className="bg-[#201F1F] w-full h-[696px] flex justify-between items-start p-5 relative z-0">
          <div className="flex flex-col text-white ml-10 mt-[300px]">
            <img className="w-[252px] h-[91px] mb-5" src={Footerlogoimg} alt="Footer Logo" />
            <div className="text-xs">
              <p>TruRide offers an innovative AI-powered platform for booking</p>
              <p>rides, featuring gamified routes. Users are incentivized with</p>
              <p>rewards for booking rides, while drivers can earn bonuses</p>
              <p>through the AI-enhanced gamified route mapping system.</p>
              <img id="icon" src={Ficonsimg} alt="Ficons" className="w-[300px] h-[30px] mt-2" />
            </div>
          </div>
          <div className="flex flex-col text-white mt-[300px]">
            <h3 className="text-xl mb-2">Company</h3>
            <ul className="space-y-1">
              <li><a href="/" className="hover:text-[#FF2E00] cursor-pointer">Home</a></li>
              <li className="hover:text-[#FF2E00] cursor-pointer">Features</li>
              <li className="hover:text-[#FF2E00] cursor-pointer">About us</li>
              <li className="hover:text-[#FF2E00] cursor-pointer">How it works</li>
              <li className="hover:text-[#FF2E00] cursor-pointer">Testimonials</li>
              <li className="hover:text-[#FF2E00] cursor-pointer">Contact us</li>
            </ul>
          </div>
          <div className="flex flex-col text-white mt-[300px]">
            <h3 className="text-xl mb-2">Contact</h3>
            <ul className="space-y-1">
              <li>(+91) 9346467553</li>
              <li>www.truridetaxi.com</li>
              <li>truridetaxi@gmail.com</li>
              <li className="mt-2">H.no-3-11-368/Flat no; 401,</li>
              <li>4th Floor, above old Indusind</li>
              <li>Finance Bank, Back side of</li>
              <li>Axis Bank, L.B Nagar,</li>
              <li>Hyderabad, Telangana</li>
              <li>500068</li>
            </ul>
          </div>
          <div className="flex flex-col text-white mt-[300px] mr-10">
            <h3 className="text-xl mb-2">Get the latest information</h3>
            <div className="flex">
              <input id="input" type="text" className="form-control w-[235px] h-[51px] p-2" placeholder="Email Address" />
              <button className="btn btn-outline-secondary w-[54px] h-[51px] bg-[#FF2E00] text-white text-2xl" type="button" id="button-addon2">▶</button>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}
